import styled from 'styled-components'

const Header = (props) => {
    return <NAV>Header</NAV>;
};

const NAV = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 70px;
  background-color: #090b13;
`;

export default Header;
